window.bookSummaryJSON = "<p>The dungeon adventures continue with Doc, Claire, and company. With the win over the Tomb of the Forgotten King, they are as strong and curious as ever. While the town recovers from the attack, Doc settles in with his new powers and improves his dungeon to new levels. New slime evolutions, traps, and floors incoming! </p> <p>Meanwhile, something is rising in the dark in Duren. To counter this, Prince James takes the center stage and decides to have his coronation ceremony in the dungeon town. However, even he can't imagine the plans in motion that will soon engulf his city and country. </p> <p>With all this happening, the mysterious cocoon in the dungeon has begun to hatch.... </p>"; 
